import React, {memo} from 'react';
import styled from 'styled-components';

const JoinContainer = styled.div`
    width:100%;

    .contentWrap{
        max-width:1200px;
        margin: 190px auto;

        .logoImg{
            width:150px;
            height: auto;
            margin-bottom: 50px;
        }

        .loginContainer{
            width:450px;
            height: 270px;
            padding:40px 25px;
            border:1px solid #d9d9d9;
            border-radius: 10px;
            display: flex;
            align-items: center;
            justify-content: center;

            .loginWrap{
                .input{
                    width:100%;
                    height: 50px;
                    border:1px solid #d9d9d9;
                    background-color: #f9f9f9;
                    color:#959595;
                    border-radius: 2px;
                    margin-bottom:10px;

                    &:focus{
                        outline:1px solid #34964B;
                    }
                }

                .submitBtn{
                    margin-top:20px;
                    width:100%;
                    height: 50px;
                    color:#fff;
                    background-color: #34964B;
                    border-radius: 2px;
                }
            }
        }

    }
`;

const Join = memo(() => {
    return (
        <JoinContainer>
            <div className='contentWrap'>
                <img src='/img/logo.png' alt='내일응원 로고' className='logoImg' />
                <div className='loginContainer'>
                    <form className='loginWrap'>
                        <input type='text' className='input inputId' placeholder='아이디를 입력하세요' />
                        <input type='text' className='input inputPw' placeholder='비밀번호를 입력하세요' />
                        <button type='submit' className='submitBtn'>로그인하기</button>
                    </form>
                </div>
                <div className='joinWrap'>
                    <span className='join'>회원가입</span>
                    <span className='idSearch'>아이디 찾기</span>
                    <span className='pwSearch'>비밀번호 찾기</span>
                </div>
            </div>
        </JoinContainer>
    );
});

export default Join;
